import React from "react";

export function UserRow({usuario,cargos,setUserSelected , userSelected}){

    const cargo = cargos.find(cargo => cargo.idcargo == usuario.idcargo)

    return <tr>
        <td>{usuario.apenom}</td>
        <td>{usuario.dni}</td>
        <td>{cargo?.cargo}</td>
        <td>{usuario.admin == 1? 'SI' : 'NO'}</td>
    </tr>
}
